import './App.css';
import React, { Component } from 'react'
import NavBar from './NavBar';
import News from './News';

export default class App extends Component {
  render() {

    return (
      <div>
        <router>
          <NavBar />
          <News pageSize={6} country="in" category="Technology" />
        </router>
      </div>
    )
  }
}
